import './App.css';
import {useState} from "react";
import {Container, Jumbotron, Navbar, Toast} from "react-bootstrap";

function App() {
    return (
        <>
            <Container className="p-3">
                <Jumbotron>
                    <h1 className="header">Welcome To React-Bootstrap</h1>
                </Jumbotron>
            </Container>
        </>
    );
}

export default App;
